import React from 'react';
//import { NavLink } from 'react-router-dom';
import web from "../src/images/image4.jpg";
import Common from "./Common";

const About = () => {
    return (
        <>
            <Common 
            name="Welcome to about page" 
            imgsrc={web} 
            visit="/contact" 
            btnname="Contact Now"
            />
            <button>Visit My Gallery</button>

        </>);
};

export default About;
